import React from "react";
import Particles from 'react-particles-js';
import Paper from '@material-ui/core/Paper';

import Title from "../components/title";
import { createMuiTheme, makeStyles, ThemeProvider } from '@material-ui/core/styles';

const Home = () => {
  const theme = createMuiTheme({
    palette: {
      type: 'dark',
      background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)'
    }
  });
  const themeDark = createMuiTheme({
    palette: {
      background: {
        default: "#000000",
      }

    },
});
  return (
    <div className='inner'>
      <ThemeProvider theme={themeDark}>
      <Paper class='paper_color' elevation={3}>
      <Title
        lineContent='Solving Solutions that'
        lineContent2='need expert insight'
      />
      <div>
        <p className='other'>
          Does project report used question death, out more rhetoric unpleasing
          what compared both of sentinels.
        </p>
      </div>
      </Paper>
      <ThemeProvider></ThemeProvider></ThemeProvider>
    </div>
  );
};

export default Home;
